class Solution {
public:
    int findMinimumOperations(string s1, string s2, string s3) {
        int ops = 0; // Initialize operations count

        // We iterate as long as none of the strings are empty
        while (!s1.empty() && !s2.empty() && !s3.empty()) {
            // Check if the rightmost characters of all strings are equal
            if (s1.back() == s2.back() && s2.back() == s3.back()) {
                // If equal, remove the rightmost character from each string
                s1.pop_back();
                s2.pop_back();
                s3.pop_back();
            } else {
                // If not equal, remove the rightmost character from the string(s) with a different character
                // and increment the operation count accordingly
                if (s1.back() != s2.back() || s1.back() != s3.back()) {
                    if (s1.back() != s2.back() || s1.length() >= max(s2.length(), s3.length())) s1.pop_back(), ops++;
                    if (s2.back() != s1.back() || s2.back() != s3.back() || s2.length() >= max(s1.length(), s3.length())) s2.pop_back(), ops++;
                    if (s3.back() != s1.back() || s3.back() != s2.back() || s3.length() >= max(s1.length(), s2.length())) s3.pop_back(), ops++;
                }
            }

            // If any two strings become empty and the third is not, return -1 as they cannot be made equal
            if ((s1.empty() && (s2.empty() || s3.empty())) || (s2.empty() && s3.empty())) return -1;
        }

        // If all strings are made equal (i.e., all are empty), return the number of operations
        // Otherwise, if they cannot be made equal, return -1
        return (s1.empty() && s2.empty() && s3.empty()) ? ops : -1;
    }
};
